import React from "react";
import { BrowserRouter as Router, Link} from "react-router-dom";
import styled from "styled-components";
import "/node_modules/flag-icons/css/flag-icons.min.css";

const Card = styled.div`
    border: 1px solid #efefef;
    background: white;
`
const Flag = styled.div`
    width: 50px;
    align: center;
    // span{
    //     align:center;
    //     height: 50x;
    //     height: 50x;
    //     border radius: 100%;
    //     border: 1px solid #efefef;
    //}
`
const MatchName = styled.div`
    padding: 20px 0 20px 0;
`

const LinkWrapper = styled.div`
    margin: 30px 0 20px 0;
    height: 50px;

    a {
        color: white;
        background: black;
        border-radius: 4px;
        padding: 10px 50px;
        border: 1px solid black;
        width: 100%;
        text-decoration: none;
    }
`

const Match = (props) => {
    return(
        <Card>
            <div> 
                <span class={`fi fi-${props.attributes.c1alpha2} fis`}></span> <span class={`fi fi-${props.attributes.c2alpha2} fis`}></span>
            </div>
            <MatchName>{props.attributes.name}</MatchName>
            <div className="Match-score">{props.attributes.avg_score}</div>
            <LinkWrapper>
                <Link to={`/matches/${props.attributes.slug}`}> View Match</Link>
            </LinkWrapper>
        </Card>
    )
}

export default Match
